function Home() {
    return (
        <div>
          <h1 className="text-success">Login Successful!!!</h1>
          <button className="btn btn-primary">Profile</button>
          <span className="mx-3">Or</span>
          <button className="btn btn-danger">Click here to Logout</button>
        </div>
    )
}

export default Home
